import React from "react";
import { NavE, NavItem, NavLogo, NavMenu } from "./Nav.element";

const Nav = () => {
  return (
    <NavE>
      <NavLogo src="images/logo.svg"></NavLogo>
      <NavMenu>
        <NavItem>About</NavItem>
        <NavItem>Download</NavItem>
        <NavItem>Pricing</NavItem>
      </NavMenu>
    </NavE>
  );
};

export default Nav;
